import React from "react";

const Header = () => {
    return(
        <header>
            <div id="headerContainer">  
                <img id="logo" src={`/river-city-tshirt-logo.png`}/>
                <img id="icon" src={`/tyler-c-icon.png`}/>
            </div>  
        </header>
    )
}

export default Header
